        # Validate evry field to add the errors to the json Object
        if($global:BeginDateFailedRows.count -gt 0) {
            $global:jsonObject.errors.BeginDate = @{
                ColName = "BeginDate"
                Rows = $global:BeginDateFailedRows
            }
        }
        if($global:EndDateFailedRows.count -gt 0) {
            $global:jsonObject.errors.EndDate = @{
