                ColName = "EducationOrganization"
                Rows = $global:EducationOrganizationFailedRows
            }
        }
        if($global:FiscalYearFailedRows.count -gt 0) {
            $global:jsonObject.errors.FiscalYear = @{
                ColName = "FiscalYear"
                Rows = $global:FiscalYearFailedRows
            }
        }
        if($global:BudgetAmountFailedRows.count -gt 0) {
