                ColName = "BudgetAmount"
                Rows = $global:BudgetAmountFailedRows
            }
        }
        if($global:BudgetFundFailedRows.count -gt 0) {
            $global:jsonObject.errors.BudgetFund = @{
                ColName = "BudgetFund"
                Rows = $global:BudgetFundFailedRows
            }
        }
        if($global:BudgetFunctionFailedRows.count -gt 0) {
            $global:jsonObject.errors.BudgetFunction = @{
                ColName = "BudgetFunction"
                Rows = $global:BudgetFunctionFailedRows
            }
        }
        if($global:BudgetObjectFailedRows.count -gt 0) {
            $global:jsonObject.errors.BudgetObject = @{
                ColName = "BudgetObject"
                Rows = $global:BudgetObjectFailedRows
            }
        }
        if($global:OrganizationFailedRows.count -gt 0) {
            $global:jsonObject.errors.Organization = @{
                ColName = "Organization"
                Rows = $global:OrganizationFailedRows
            }
        }
        if($global:BudgetProgramIntentFailedRows.count -gt 0) {
            $global:jsonObject.errors.BudgetProgramIntent = @{
                ColName = "BudgetProgramIntent"
                Rows = $global:BudgetProgramIntentFailedRows
            }
        }
        
        $global:jsonObject.finished = Get-Date -Format "HH:mm:ss"   
        return $global:jsonObject
    }
   
     # Convert an array list of data into a CSV line for output
    function Get-CSVLine($inputData) {
        $ret = ""
        foreach ($cell in $inputData) {
            if ($ret -ne "") { $ret += "," }
            $ret += ('"' + $cell + '"')
        }
        return $ret
    }


    function Get-ParsedDate ($date) {             
        <# 
            .SYNOPSIS
                Parse a date string and returns it in the correct format (yyyy-MM-dd).
    
            .PARAMETER date (required)
                The date string to parse
    
            .OUTPUTS
    
